import React from "react";
import Style from "./Style";
import Container from "./Container";
import title from "./title2.svg";

const Main = () => {
  return (
    <Container>
      <Style>
        <div className="main">
          <div className="body">
            <p className="title1">Наслаждайся жизнью,</p>
            <img src={title} alt="" />
          </div>
          <div className="d-flex justify-content-between">
            <p>Инновация</p>
            <p>
              Движимый инновациями и стремлением к совершенству, Chery Holding
              полон решимости стать лидером в каждой из своих областей и стать
              влиятельным и заслуживающим доверия брендом группы.
            </p>
          </div>
        </div>
      </Style>
    </Container>
  );
};

export default Main;
